$(document).ready(function(){var m=new Date("August 17, 2019 05:30:00").getTime(),l=setInterval(function(){var e=(new Date).getTime(),t=m-e,n=Math.floor(t/864e5),o=Math.floor(t%864e5/36e5),a=Math.floor(t%36e5/6e4),r=Math.floor(t%6e4/1e3);document.getElementById("time").innerHTML=n+"d "+o+"h "+a+"m "+r+"s ",t<0&&(clearInterval(l),document.getElementById("time").innerHTML="GAME DAY.")},1e3)});